import React from 'react';
import "./Gallery.css"

import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, {EffectCube, Navigation, Pagination, Scrollbar,} from 'swiper';



import 'swiper/swiper.scss';
import 'swiper/components/effect-cube/effect-cube.scss';




import 'swiper/swiper.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/pagination/pagination.scss';
import 'swiper/components/scrollbar/scrollbar.scss';


SwiperCore.use([EffectCube, Navigation, Pagination, Scrollbar,]);







export default function Gallery() {

  return (
      <>



      <div className= "backgroundImage" >


                    <div className="slideshow">  

                    <Swiper
                        className="swiper-slideshow"
                        effect="cube"
                        navigation
                        pagination={{ clickable: true }}
                        cubeEffect={{ slideShadows: false }}
                        scrollbar={{ draggable: true }}


                        breakpoints={{
                          // when window width is >= 640px
                          640: {
                            width: 640,
                            slidesPerView: 1,
                          },
                          // when window width is >= 768px
                          768: {
                            width: 768,
                            slidesPerView: 2,
                          },
                        }}
                        >
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0007.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0008.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0009.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0010.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0011.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0012.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0013.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0014.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0015.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0016.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0017.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0018.jpg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/IMG-20201121-WA0019.jpg" alt=""/></SwiperSlide>


                        </Swiper>





        </div>  

     </div>  

</>


  )}
